import React from 'react'
import PostPage from './PostPage '
import useFetch from '../hooks/useFetch'

const PostPageContainer = () => {

    const {data} = useFetch('http://127.0.0.1:8001/post/post/')

    return <PostPage
        data={data}            
    />
}

export default PostPageContainer
